import React from "react";
export default function Circle() {
  return (
    <svg xmlns="http://www.w3.org/2000/svg" viewBox="0 0 20 20"><circle cx="10" cy="10" r="9" fill="none" stroke="#231e28" stroke-linecap="round" stroke-linejoin="round" stroke-width="2"/></svg>
  );
}
